const ItemCount = ({setCount}) => {

return (
        <div className="buttom">
            <button  className="btn" onClick={()=> setCount((currentValue)=> currentValue +1)}>+</button>
            
            <button className="btn" onClick={()=> setCount((currentValue)=> currentValue -1)}>-</button>
        </div>
    );
};

export default ItemCount;
